import React, { ReactNode, useState } from 'react';
import './Messagerie.css';

const MainFrame = ({
	title,
	children,
}: {
	title: string;
	children: ReactNode;
}) => {
	return (
		<div className="main-frame">
			<h1>{title}</h1>
			{children}
		</div>
	);
};

interface NavbarProps {
	navbarStatus: string;
	setNavbarStatus: (status: string) => void;
}

const Navbar = ({ navbarStatus, setNavbarStatus }: NavbarProps) => {
	return (
		<div className="navbar">
			<button
				className={
					navbarStatus === 'privateMessage' ? 'active' : undefined
				}>
				Private Message
			</button>
			<button>Channel</button>
		</div>
	);
};

export const Messagerie = () => {
	const [navbarStatus, setNavbarStatus] = useState('privateMessage');

	return (
		<div className="messagerie-wrapper">
			<MainFrame title="Messagerie">
				<p></p>
			</MainFrame>
		</div>
	);
};
